import React from 'react';
import {AppBar, Toolbar} from "@material-ui/core";

const Navbar = () => {
    return (
        <AppBar position="static">
            <Toolbar variant="dense">
            </Toolbar>
        </AppBar>
    );
};

export default Navbar;
